import React, { Component } from 'react';
import { Row,Carousel,Pagination, Card, Col, Button} from 'antd';
import PropTypes from 'prop-types';
import Pokemonlist from './PokemonList';
import './pokego.css'




class Pokemongo extends Component{
    state = {
        isLoading: true,
        Pokemon:[]
            }
    handlefacebookClick = () => {
        const details=[];
        Pokemonlist.map(async (Pokemonlist) => {
          const url= `https://pokeapi.co/api/v2/pokemon/${Pokemonlist.name}`;
          const response= await fetch(url);
          const pokedata= await response.json();
          details.push({
            name: pokedata.species.name  
          })
          this.setState({Pokemon: details, isLoading:false})
        });

    }


    render(){
        const { Pokemon} = this.state;
        console.log(Pokemon.name);
        return (
            <div className="pok" >
                <button onClick={this.handlefacebookClick}>
                    click
                </button>
            </div>

            )
        // );
    }
};
export default Pokemongo;
